            request,
            (bytes, address)
        );
        address signer = ECDSA.recover(
            makeSignatureHash(sender, expires, extraData, result),
            sig
        );
        require(
            expires >= block.timestamp,
            "SignatureVerifier: Signature expired"
        );
        return (signer, result);
    }
}

